import styled from "styled-components"

const FormCtn = styled.form`
	background-color: #eee;
	display: flex;
	justify-content: space-between;
	align-items: center;
	padding: 20px;
	gap: 20px;
`

const InputArea = styled.div`
	display: flex;
	align-items: center;
	gap: 20px;
	font-weight: 700;
`
const InputTitle = styled.label`
	min-width: 30px;
`
const InputBody = styled.input`
	border: none;
	width: 250px;
	height: 40px;
	border-radius: 10px;
	padding: 0 12px;
`

const InputBtn = styled.button`
	background-color: #1a73e8;
	color: white;
	font-weight: 700;
	border: none;
	border-radius: 10px;
	height: 40px;
	width: 130px;
	&:hover {
		background-color: gray;
	}
`

function Form() {

	return (
        <FormCtn>
            <InputArea>
                <InputTitle>제목</InputTitle>
                <InputBody

				/>
                <InputTitle>내용</InputTitle>
                <InputBody
				/>
            </InputArea>
            <InputBtn>추가하기</InputBtn>
        </FormCtn>
    )
}

export default Form
